import React, { useState } from "react";
import Button from "react-bootstrap/Button";
import "./Register.css";
import xlogo from "../../assets/xlogo.png";

function Register() {
  const [name, setname] = useState("");
  const [username, setusername] = useState("");
  const [email, setemail] = useState("");
  const [password, setpassword] = useState("");
  return (
    <>
      <div className="reg-section">
        <img className="x-img" src={xlogo} alt="" />

        <form className="reg-form" ons>
          <input placeholder="name" className="reg-input" type="text" />
          <input placeholder="username" className="reg-input" type="text" />
          <input placeholder="email" className="reg-input" type="email" />
          <input placeholder="password" className="reg-input" type="password" />
          <div className="reg-btn-div">
            <Button className="reg-btn" variant="success">
              Register ..
            </Button>
            <Button className="login-btn" variant="danger">
              Login ..
            </Button>
          </div>
        </form>
      </div>
    </>
  );
}

export default Register;
